import React from 'react';
import PirateList from '../pirates/PirateList';

const Ship = ({ship, pirates, raid}) => {

	const pirateNodes = pirates.map((pirate) => {
		return <h1> {pirate.firstName}</h1>
	})


	return (
		<div>
			<p className="name">
				{ship.name}
			</p>
			<p>pirateNodes</p>
		</div>
	)
}

export default Ship;
